import React from 'react';
import { useAuth0 } from "@auth0/auth0-react";

import '../styles/home.css';

const Home = () => {

    const { loginWithRedirect } = useAuth0();

    return (
        <>
            <button className="btn btn-outline-primary" onClick={() => loginWithRedirect()}>Log In</button>
        </>
    )
}

export default Home;
